INSERT INTO `f_a_q_s` (`id`, `title`, `image`, `content`, `created_at`, `updated_at`) VALUES
(8, 'Часто задаваемые вопросы', '1596782757020_маг2.jpg', '<p>&nbsp;</p>\r\n<h1 class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Часто задаваемые вопросы</strong></h1>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><strong>Мы часто получаем вопросы, типа: &laquo;А у вас оригинал?&raquo;, &laquo;А доставляете в страны СНГ?&raquo; и прочие. </strong></p>\r\n<p class=\"MsoNormal\"><strong>Решили закрыть эти вопросы раз и навсегда, ответив на них здесь.</strong></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h3 class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">&laquo;Вы завозите только оригинальную продукцию?&raquo;</strong></h3>\r\n<p class=\"MsoNormal\">Да, все бренды, представленные в магазине &ndash; 100% оригинал. Мы являемся официальными дилерами.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h3 class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">&laquo;А ваши доски </strong><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Wallride</span> качественные?&raquo;</strong></h3>\r\n<p class=\"MsoNormal\">Да, мы долго выбирали завод и остановились на испанском, где производятся такие бренды <span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Plan</span> <span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">B</span>, <span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Skate</span> <span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Mafia</span>, <span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Jart</span>. Доски на 100% произведены из канадского клена.</p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">&nbsp;</strong></p>\r\n<h3 class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">&laquo;Сломал доску в первый день, как мне быть, мне ее заменят?&raquo;</strong></h3>\r\n<p class=\"MsoNormal\">Мы искренне тебе сочувствуем, но такое случается и довольно часто. Это не значит, что доска плохая, это значит, что возможно, ты неправильно приземлился, делая очередной трюк.</p>\r\n<p class=\"MsoNormal\">Доска сделана из дерева, не из железа. В скейтбординге &ndash; это расходный материал, как и кроссовки.</p>\r\n<p class=\"MsoNormal\">Если ты боишься сломать доску, старайся трюки максимально аккуратно, рассчитывай свои возможности и приземляйся правильно.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h3 class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">А что насчет доставки?</strong></h3>\r\n<p class=\"MsoNormal\">Доставим вещь в любую точку земного шара. При доставке важный фактор &ndash; это вес и, конечно, точка назначения, от нее зависит и конечная стоимость доставки.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h3 class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">А почему у вас нет готовых скейт-комплитов? </strong></h3>\r\n<p class=\"MsoNormal\">Все просто &ndash; готовые комплиты не такие качественные и крутые, как комплиты, которые ты собираешь сам. Чаще всего, на таких досках стоят обычные, дешевые подвески, мягкие и не очень удобные колеса и плохо крутящиеся подшипники.</p>\r\n<p class=\"MsoNormal\">Наш совет &ndash; собирать скейтборд по частям, комплектующие прослужат вам дольше, а комфорта будет больше.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h3 class=\"MsoNormal\"><strong>Я новичок, хочу собрать доску, но стоит ли брать сразу хорошую доску? </strong></h3>\r\n<p class=\"MsoNormal\">Однозначно, да. На хорошем комплите с качественными комплектующими будет намного комфортнее и приятней кататься, нежели на китайской доске, купленной на базаре.</p>\r\n<p class=\"MsoNormal\">Как показывает наша практика, новички часто тратились на плохие доски, тем самым &laquo;убив&raquo; в себе желание кататься, поскольку &laquo;скейтборды с базара&raquo;, назовем их так, не обладают теми качествами, которыми обладает хороший комплит: плохие колеса, медленные подшипники, неудобные подвески и сама доска, сделанная из плохого дерева. &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2020-07-18 15:54:50', '2020-08-07 10:45:58'),
(9, 'Как собрать скейтборд? Большая статья, много букв.', '1596782769967_маг1.jpg', '<h2>Как собрать скейтборд и что нужно знать?&nbsp;</h2>\r\n<p>&nbsp;</p>\r\n<h3 class=\"MsoNormal\">Информация, которая будет полезна не только новичкам, но и опытным райдерам.</h3>\r\n<h3 class=\"MsoNormal\">Итак, раскрываем вопросы: Как собрать скейтборд? Из чего состоит скейтборд? Особенности доски и тд.</h3>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Для начала давайте запомним, из чего состоит собранный комплит.</p>\r\n<p class=\"MsoNormal\">Запоминайте слова, их будет много: Дека &ndash; сама доска, подвески &ndash; то, куда крепится доска и колеса, подшипники &ndash; деталь, обеспечивающая езду.</p>\r\n<p class=\"MsoNormal\">А теперь поговорим о каждой детали глубже.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h2 class=\"MsoNormal\">Дека</h2>\r\n<p class=\"MsoNormal\">Настоящие, профессиональные деки &ndash; это 5, 7, либо 9 слоев канадского и китайского клена.</p>\r\n<p class=\"MsoNormal\">Дека может быть разной ширины и длины. Соответственно, при покупке, размер необходимо подбирать.</p>\r\n<p class=\"MsoNormal\">Ширина измеряется в дюймах. Размеры варьируются от 7.5 до 9.0.</p>\r\n<p class=\"MsoNormal\">Есть некоторые стандарты, что широкие доски для рампы, а узкие для того, чтобы крутились флипы лучше, но как показывает практика, здесь &ndash; это дело предпочтений и удобства. Но, конечно, если твой размер ноги 45, а ты хочешь доску 7.5 &ndash; это будет ошибочным решением.</p>\r\n<p class=\"MsoNormal\">Тебе как минимум будет будет комфортно на размерах 8.3-8.5</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><strong>Обрати внимание</strong>: на слишком широкой деке делать флипы сложнее, а на чересчур узкой - прыгать с большой высоты и кататься в радиусах.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Длина стандартной деки варьируется в пределах от 28 до 33 дюймов. Обычно, чем шире дека, тем она длиннее. Длина деки не имеет столь приоритетного значения при выборе и не оказывает значительного влияния на катание. Это характеристика, как говорится, больше на вкус и цвет.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><strong>Обрати внимание</strong>: если ты высокий, среди досок одной ширины бери доску подлиннее.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h2 class=\"MsoNormal\"><span lang=\"EN-US\">Nose </span>и <span lang=\"EN-US\">Tail </span></h2>\r\n<p class=\"MsoNormal\">У каждой деки есть \"нос\" и \"тейл\" или \"хвост\" в простонародье. Иногда бывает даже сложно разобраться, где и что находится. Обычно \"нос\" чуть больше и загнут сильнее. Если на доске есть какая-то большая надпись с названием бренда, то обычно она пишется от носа к тейлу.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h2 class=\"MsoNormal\">Конкейв: Прогиб между краями деки</h2>\r\n<p class=\"MsoNormal\">Если посмотреть на деку в поперечном разрезе, то сразу видно, что доска имеет прогиб, который называется \"конкейвом\" от англ. &ldquo;concave&rdquo;, что переводится дословно как &ldquo;вогнутый/впалый&rdquo;. Этот параметр также является существенным, как и ширина.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Например, у досок <strong><span lang=\"EN-US\">Wallride</span> </strong>&ndash; глубокий конкейв, кототорый обеспечивает удобство при выполнении технически сложных трюков, флипов. Условно &ndash; доска лучше крутится.</p>\r\n<p class=\"MsoNormal\">Доски доступны в 5 графиках и разных размерах: 8.1, 8.25, 8.3, 8.5. При покупке доски, мы дарим нождак в подарок.</p>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>\r\n<h2 class=\"MsoNormal\">Подвески</h2>\r\n<p class=\"MsoNormal\">Подвески &ndash; это металлические детали, которые крепятся к доске. Хорошие подвески &ndash; залог хорошего катания. Состоят из нескольких частей: Axle (ось), Hanger, Kingpin (кингпин), и Bushings (бушинги).</p>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>\r\n<p class=\"MsoNormal\"><strong>Выбираем правильный размер подвесок </strong></p>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>\r\n<p class=\"MsoNormal\">Тут все достаточно просто. Размер подвески не должен вылазить за пределы доски, а также не должен быть намного меньше самой доски.</p>\r\n<p class=\"MsoNormal\">Мы сделали размерную сетку из трех брендов, которые представлены в нашем магазине. Так вы сможете подобрать себе подвески онлайн, не приходя в магазин. Достаточно только взглянуть на таблицу.</p>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong><strong>&nbsp;</strong></p>\r\n<table class=\"MsoTableGrid\" style=\"border: none;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 155.75pt; border-width: 1pt; border-color: windowtext; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><strong>Бренд</strong></p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top-width: 1pt; border-right-width: 1pt; border-bottom-width: 1pt; border-top-color: windowtext; border-right-color: windowtext; border-bottom-color: windowtext; border-left: none; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><strong>Размер подвесок</strong></p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top-width: 1pt; border-right-width: 1pt; border-bottom-width: 1pt; border-top-color: windowtext; border-right-color: windowtext; border-bottom-color: windowtext; border-left: none; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><strong>Размер доски</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 155.75pt; border-right-width: 1pt; border-bottom-width: 1pt; border-left-width: 1pt; border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-top: none; paddi