bottom: .0001pt; line-height: normal;\">7,4&Prime; &mdash; 7,9&Prime;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 155.75pt; border-right-width: 1pt; border-bottom-width: 1pt; border-left-width: 1pt; border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-top: none; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">&nbsp;</p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-bottom-color: windowtext; border-right-width: 1pt; border-right-color: windowtext; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">147</p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-bottom-color: windowtext; border-right-width: 1pt; border-right-color: windowtext; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">7,9&Prime; &mdash; 8,12&Prime;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 155.75pt; border-right-width: 1pt; border-bottom-width: 1pt; border-left-width: 1pt; border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-top: none; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">&nbsp;</p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-bottom-color: windowtext; border-right-width: 1pt; border-right-color: windowtext; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">148</p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-bottom-color: windowtext; border-right-width: 1pt; border-right-color: windowtext; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">8,12&Prime; &mdash; 8,38&Prime;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 155.75pt; border-right-width: 1pt; border-bottom-width: 1pt; border-left-width: 1pt; border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-top: none; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">&nbsp;</p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-bottom-color: windowtext; border-right-width: 1pt; border-right-color: windowtext; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">149</p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-bottom-color: windowtext; border-right-width: 1pt; border-right-color: windowtext; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">8,38&Prime; &mdash; 8,62&Prime;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 155.75pt; border-right-width: 1pt; border-bottom-width: 1pt; border-left-width: 1pt; border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-top: none; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">&nbsp;</p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-bottom-color: windowtext; border-right-width: 1pt; border-right-color: windowtext; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">151&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n</td>\r\n<td style=\"width: 155.75pt; border-top: none; border-left: none; border-bottom-width: 1pt; border-bottom-color: windowtext; border-right-width: 1pt; border-right-color: windowtext; padding: 0cm 5.4pt;\" valign=\"top\" width=\"208\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">8,62&Prime; и больше</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h2 class=\"MsoNormal\">Колеса</h2>\r\n<p class=\"MsoNormal\">Что касается колес, то при их выборе необходимо учитывать несколько параметров: диаметр и жесткость.</p>\r\n<p class=\"MsoNormal\">От диаметра колес зависит скорость, соответственно, на колесах больше, вы будете ездить быстрее.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Жесткость колес напрямую влияет на стиль вашего катания. Для колёс обычно применяют шкалу A и очень редко шкалу B (она более жёсткая). Иногда еще бывает D шкала - она самая жесткая. Но, самая распространенная, конечно, А.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><strong>73a - 87a</strong> &ndash; Мягкие колёса для неровных дорог, подходят для круизеров и хорошего сцепления с дорогой.</p>\r\n<p class=\"MsoNormal\"><strong>88a - 95a</strong> &ndash; твёрже предыдущих, часто ставятся на лонгборды и парковые доски.</p>\r\n<p class=\"MsoNormal\"><strong>96a - 99a</strong> &ndash; самые популярные колёса для парка и улицы. Хорошее сочетание скорости и сцепления.</p>\r\n<p class=\"MsoNormal\"><strong>101a и твёрже </strong>&ndash; для опытных скейтеров. Такая жёсткость лучше подходит для скольжений по граням и перилам, легче набирается скорость.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h2 class=\"MsoNormal\">Подшипники</h2>\r\n<p class=\"MsoNormal\">Несмотря на столь малый размер подшипников, катание напрямую зависит от их состояния и качества. Все подшипники для скейтбордов имеют одинаковые размеры, поэтому выбирать их намного проще, чем деку, колёса или подвески. Тем не менее, есть несколько тонкостей, о которых мы расскажем в этом материале.</p>\r\n<p class=\"MsoNormal\">Мы не будем рассказывать о технических составляющих подшипников, ибо будет долго, скучно и местами непонятно, поэтому о подшипниках коротко и понятно.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><strong>ABEC</strong> (Annular Bearing Engineering Committee) - аббревиатура, введённая в оборот Американской Ассоциацией Производителей Подшипников (ABMA). Шкала ABEC состоит из 5 значений и обозначает степень точности подшипника.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">В подробности больше вдаваться не будем, но расскажем, как <span lang=\"EN-US\">ABEC</span> влияет на скорость.</p>\r\n<p class=\"MsoNormal\">Есть высокопрециозные подшипники &ndash; это <span lang=\"EN-US\">ABEC</span> 7 и <span lang=\"EN-US\">ABEC</span> 9, они, можно сказать, самые скоростные, имеют высокое качество производства и дольше сохраняют набранную скорость.</p>\r\n<p class=\"MsoNormal\"><strong>Однако подшипники нужно выбирать по стилю катания.</strong></p>\r\n<p class=\"MsoNormal\">Не нужно покупать ABEC-9, если вы катаетесь по перилам, дропаете с парапетов и на подшипники будет оказываться много ударной нагрузки. Для такого катания подойдут ABEC-3 и ABEC-5 хорошего производителя. Для круизинга и катания в радиусах лучше выбирать высокоточные подшипники ABEC-7 и ABEC-9.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h3 class=\"MsoNormal\">Стальные или керамические подшипники?</h3>\r\n<p class=\"MsoNormal\">Почти все материалы имеют свойство расширяться при нагреве, в том числе и сталь, из которой изготавливаются стандартные подшипники. При вращении на высоких скоростях стальные шарики нагреваются и расширяются, увеличивается трение и износ внутренних элементов, что приводит к разрушению и выходу подшипника из строя. Для решения этой проблемы были созданы гибридные подшипники, в которых вместо стальных шариков стали использовать керамические. Именно такой тип керамических подшипников используется скейтбордистами.</p>\r\n<p class=\"MsoNormal\">Кроме того, керамические шарики легче (уменьшается центробежная сила), имеют меньшую шероховатость (снижается трение), а также менее требовательны к смазке, что делает керамические (гибридные) подшипники еще эффективнее на высоких скоростях вращения.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h3 class=\"MsoNormal\">Об уходе за подшипниками</h3>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong>Основные &ldquo;враги&rdquo; подшипников:</p>\r\n<p class=\"MsoNormal\"><strong>&middot; вода</strong></p>\r\n<p class=\"MsoNormal\"><strong>&middot; абразив (пыль, песок, грязь и т.д.)</strong></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Чтобы ваши подшипники не вышли из строя раньше времени, мы рекомендуем их регулярно чистить, промывать и смазывать. Мы рекомендуем следующую последовательность:</p>\r\n<p class=\"MsoNormal\">&middot; Снимите защитные пыльники (хотя бы один).</p>\r\n<p class=\"MsoNormal\">&middot; Если есть возможность, извлеките пластиковый сепаратор.</p>\r\n<p class=\"MsoNormal\">&middot; С помощью зубной щётки прочистите внутреннюю часть обоймы и шарики</p>\r\n<p class=\"MsoNormal\">&middot; Положите подшипники в банку (лучше пластиковую), налейте бензин, плотно закройте крышкой и интенсивно болтайте пару минут. Бензин вымоет остатки старой смазки вместе с пылью и грязью. Сливайте грязный бензин и переходите к следующему этапу промывки.</p>\r\n<p class=\"MsoNormal\">&middot; Налейте бензин в плоскую ёмкость и поочередно промывайте каждый подшипник, удаляя остатки загрязнений. Качество промывки проверяйте вращением, чистый подшипник будет вращаться свободно.</p>\r\n<p class=\"MsoNormal\">&middot; Просушите чистые подшипники и смажьте. Можно использовать как пластичные (густые) смазки на литиевой основе, так и жидкие. Густая смазка лучше защищает от абразива и дольше сохраняется внутри подшипника. Жидкие смазки проще в нанесении, но требуют более частого обслуживания.</p>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>\r\n<p class=\"MsoNormal\"><strong>Не рекомендуется использовать:</strong></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">&middot; солидол - он содержит воду, которая в процессе катания испарится и вместо смазки останется твёрдая субстанция</p>\r\n<p class=\"MsoNormal\">&middot; WD-40 - это &ldquo;газированный керосин&rdquo;, промывка! Вместо ожидаемой смазки, вы получите противоположный эффект - вымывание остатков смазки и более быстрый выход подшипников из строя.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Разобрали почти все комплектующие, однако есть еще <strong>гриптейп</strong>, <strong><span lang=\"EN-US\">hardware</span> </strong>(болты) и<strong> <span lang=\"EN-US\">riser</span> <span lang=\"EN-US\">pad</span></strong> (подкладки)</p>\r\n<p class=\"MsoNormal\">На всех досках используется стандартный гриптейп, однако вы можете персонализировать вашу доску, купив гриптейп с интересной графикой, либо сделать это самостоятельно.</p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"EN-US\">Hardware</span> </strong>&ndash; болты, которые соединяют доску с подвеской. Болты могут быть разных размеров, поэтому если вы катаетесь без райзер падов, то вам подойдут и короткие, но если с райзерами, то покупайте болты подлиннее.</p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"EN-US\">Riser</span> <span lang=\"EN-US\">pads</span></strong> &ndash; подкладки, которые устанавливаются между подвеской и доской и закрепляются болтами.</p>\r\n<p class=\"MsoNormal\"><strong>Подкладки </strong>имеют несколько функций. Во-первых, они гасят вибрации во время катания, и уменьшают удары по скейту. Во-вторых, увеличивают зазор между колесом и декой.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<h3 class=\"MsoNormal\">Если ты дочитал статью до конца &ndash; ты наш герой, ты узнал о скейтборде чуть больше.</h3>\r\n<h3 class=\"MsoNormal\">&nbsp;</h3>\r\n<h3 class=\"MsoNormal\">А теперь можешь собрать комплит на нашем сайте. Если есть вопросы &ndash; пиши в наш инстаграм @<span lang=\"EN-US\">wallride</span>_<span lang=\"EN-US\">store</span></h3>\r\n<p>&nbsp;</p>', '2020-07-19 16:34:26', '2020-08-07 10:46:11');
