(14, '<div class=\"wall_post_text\" style=\"text-align: center;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Free Skateboard Magazine Issue 34 уже в нашем магазине!</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">К каждой покупке в подарок!</span></div>\r\n<div class=\"wall_post_text\" style=\"text-align: center;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Количество ограничено!</span></div>\r\n<div class=\"page_post_sized_thumbs  clear_fix\" style=\"text-align: center;\">&nbsp;</div>', 'Free Skateboard Magazine Issue 34', '1610887827509_dgdfh копия.jpg', '2021-02-02 14:27:40', '2021-01-17 16:50:51', '2021-02-02 14:27:40'),
(15, '<p style=\"padding-left: 120px; text-align: center;\"><span style=\"font-family: georgia, palatino, serif;\">Медиа сфера в скейтбординге довольно сильно изменилась за последнее десятилетие. Но вопреки всему, печатные издания все еще в почёте и более чем живы. Если вы являетесь ценителем насыщенного текста, высококачественной печати и фотографии, а самое главное, скейтбординга, то <strong>Pocket Skate Magazine</strong> определённо для вас.</span></p>\r\n<p style=\"padding-left: 120px; text-align: center;\">&nbsp;</p>\r\n<p style=\"padding-left: 120px; text-align: center;\"><img src=\"https://sun9-73.userapi.com/impf/yXG0APPif4bvjqoDCamHw3eh00_cpdTzZoaTOg/lLrX9w8_vKQ.jpg?size=1727x2160&amp;quality=96&amp;sign=fe357c95f4422a7757937675e8219167&amp;type=album\" /><br /><br /><span style=\"font-family: georgia, palatino, serif;\">Книги Pocket наполнены огромным количеством невероятных деталей, что свидетельствует о любви и страсти создателей, Йоханнеса (Johannes Sch&ouml;n) и Бёрни (Florian \"Burny\" Hopfensperger), к печатным материалам и самому скейтбордингу. Pocket Skate Magazine это идеальный материал для чтения в дождливый день, после очередного дня катания с друзьями или в те моменты, когда вам нужна серьезная мотивация.</span><br /><br /><span style=\"font-family: georgia, palatino, serif;\">Последний, 5-ый выпуск книги Pocket, о скейтбординге во время пандемии, можно приобрести в нашем магазине и на сайте wallridestore.com&nbsp;</span></p>', 'Pocket Skateboard Magazine Vol. 5 в Wallride Store', '1614601627124_unnamed.jpg', NULL, '2021-02-02 14:45:11', '2021-03-01 16:28:19');
