(987, 'Independent Polished Mid 139 Skateboard Trucks', '<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">New Independent MiD trucks feature a lower profile hanger for optimal contact point angle on your nose and tail for flip tricks, ledges, and all-around street skating with a recommended wheel size of 53mm and under.</span></p>\r\n<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">The newly designed and first ever Independent inverted kingpin can be used with either a 5.5mm Allen key or standard 9/16\" hex wrench. The innovative new Shaft Nut in the baseplate creates a rigid and durable solution to lateral movement found in most inverted kingpin designs and increases adjustability.</span></p>\r\n<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">The new MiD is 52mm tall and built on Independent legendary geometry with full size cushions for maximum turning action and comes in 129, 139, 144, 149, 159 sizes.</span></p>\r\n<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">The all new design includes a new baseplate stamp and size designations underneath the hanger for easy identification.</span></p>\r\n<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">52mm tall</span></p>\r\n<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">356 Aluminum hanger and baseplate</span></p>\r\n<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">4140 Chromoly steel axle</span></p>\r\n<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Inverted Grade 8 kingpin w/ 9/16\" &amp; 5.5mm Allen</span></p>\r\n<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Steel Shaft Nut with nylon locking insert</span></p>\r\n<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Цена за пару</span></p>', 0, 0, 0, 0, 1, '25900.00', NULL, '1.00', '{\"keywords\": \"Independent Polished Mid 139 Skateboard Trucks\", \"description\": \"Independent Polished Mid 139 Skateboard Trucks\"}', '2021-04-16 15:54:31', '2021-01-28 14:33:55', '2021-04-16 15:55:05'),
