INSERT INTO `products` (`id`, `title`, `description`, `on_sale`, `on_new`, `on_top`, `on_block_free_transfer`, `sold_count`, `price`, `price_sale`, `weight`, `meta`, `deleted_at`, `created_at`, `updated_at`) VALUES
(999, 'Pocket Vol. 5', '<p style=\"line-height: 1.1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">People like to make plans. Makes you feel like you have control. Turns out you don&rsquo;t have any. While plans are kind of useless, the art of planning isn&rsquo;t. And let me tell you we had a lot of plans for this year and Pocket Vol. 5, but only planning even more helped us manifest these pages into reality.</span></p>\r\n<p style=\"line-height: 1.1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Our past 2 books were solely based around trips. One of the things we love the most about skateboarding.</span></p>\r\n<p style=\"line-height: 1.1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Even though we got used to the lifestyle we live, the fact that skateboarding opened up the world for us was never taken for granted. But this year really put a lot of things into perspective. We realized how something certain like traveling can quickly become uncertain. The narrative of 2020. Yet, it feels weird to write about 2020. It&rsquo;s been challenging for everyone. While one might got away with a black eye someone else&rsquo;s life got turned upside down. No words that could do every reader justice, which is why throughout this whole book we decided to keep the words to a minimum. Let the images tell their story and spark positivity.</span></p>\r\n<p style=\"line-height: 1.1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">All photos in this book were shot during the pandemic in the months from May to October. Five months of everybody figuring shit out. Despite the odds, we even got a little bit of traveling in when we visited friends in Paris and took a squad to Madrid and Lisbon for our Pocket: MADLIS project. And for the weeks before, between, and after these trips we curated photos from all over the world showing you what our friends had been up to.</span></p>\r\n<p style=\"line-height: 1.1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">We hope flipping through these pages (and finding the hidden ones) will help appease your wanderlust.</span></p>\r\n<p style=\"line-height: 1.1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Take care friends, take care of your friends and stay healthy!</span></p>\r\n<p style=\"line-height: 1.1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Much Love</span><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">Burny &amp; Johannes</span></p>', 0, 0, 0, 0, 0, '9900.00', NULL, '0.30', '{\"keywords\": \"Pocket Vol. 5\", \"description\": \"People like to make plans. Makes you feel like you have control. Turns out you don’t have any. While plans are kind of useless, the art of planning isn’t. And let me tell you we had a lot of plans for this year and Pocket Vol. 5, but only planning even more helped us manifest these pages into reality.  Our past 2 books were solely based around trips. One of the things we love the most about skateboarding.  Even though we got used to the lifestyle we live, the fact that skateboarding opened up the world for us was never taken for granted. But this year really put a lot of things into perspective. We realized how something certain like traveling can quickly become uncertain. The narrative of 2020. Yet, it feels weird to write about 2020. It’s been challenging for everyone. While one might got away with a black eye someone else’s life got turned upside down. No words that could do every reader justice, which is why throughout this whole book we decided to keep the words to a minimum. Let the images tell their story and spark positivity.  All photos in this book were shot during the pandemic in the months from May to October. Five months of everybody figuring shit out. Despite the odds, we even got a little bit of traveling in when we visited friends in Paris and took a squad to Madrid and Lisbon for our Pocket: MADLIS project. And for the weeks before, between, and after these trips we curated photos from all over the world showing you what our friends had been up to.  We hope flipping through these pages (and finding the hidden ones) will help appease your wanderlust.  Take care friends, take care of your friends and stay healthy!  Much Love Burny & Johannes\"}', NULL, '2021-02-02 14:19:22', '2021-02-02 14:19:22'),
