(1033, 'Bronson Ceramic Bearings', '<p style=\"line-height: 1;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Bearing Cleaning Unit Package - Case doubles as a bearing cleaning unit by following the included instruction sheet.</span><br /><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">High Density Ceramic Balls - Precision made, Hot Isostatic Pressure Sintered (HIPS) Silicon Nitride ceramic balls are super-fast, smooth rolling, and durable for extended use.</span><br /><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">Deep Groove Raceways - Balls roll deep in raceway channels - reduces side impact damage &amp; breakage.</span><br /><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">Straight Edge Frictionless Shields - Pop off resistant - hold oil in, dirt and moisture out - easy to clean.</span><br /><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">Max Impact Cage Design - non- distortion custom cage keeps the balls precision spaced &amp; oil circulating.</span><br /><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">Micro Groove Raceway Surfaces - linear micro-groove surfaces improve bearing lubrication, speed and spin.</span><br /><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">High Speed Ceramic Oil - Nano-ceramic compound for wear protection - moisture, rust, &amp; corrosion resistant.</span><br /><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">Balls Out Technology - Eliminates shield and cage contact on impact for a go fast, stay fast bearing.</span><br /><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">Factory Fresh Quality - Nitrogen filled shrink wrap, reduces metal &amp; oil oxidation until ready to be ridden.</span><br /><br /><span style=\"font-family: \'book antiqua\', palatino, serif;\">Package inludes: Bearing cleaning unit case, 8 ceramic bearings, 4 spacers, 8 washers, and 8 extra replacement shields</span></p>', 0, 0, 0, 0, 0, '33900.00', NULL, '0.20', '{\"keywords\": \"Bronson Ceramic Bearings\", \"description\": \"Bronson Ceramic Bearings\"}', NULL, '2021-02-09 14:11:54', '2021-02-09 14:11:54'),
